import React from 'react';


const App = () => {
  return (
    <div className='app sunny'>
      <main>
        <div className="search_box">
          <input type="text"
            className="search_bar"
            placeholder="Search..." />
        </div>
      </main>
    </div>
  )
}
export default App;
